import React from "react";
import Header from "./header"
import styles from "../node_modules/chatscope/chat-ui-kit-styles/dist/default/styles.min.css";
import {
  MainContainer,
  ChatContainer,
  MessageList,
  Message,
  MessageInput,
} from "@chatscope/chat-ui-kit-react";


const Home = () => {
	return (
		<div>
			<Header />

		<div style={{ position: "relative", height: "500px" }}>
		<MainContainer>
		  <ChatContainer>
			<MessageList>
			  <Message
				model={{
				  message: "Hello my friend",
				  sentTime: "just now",
				  sender: "Joe",
				}}
			  />
			</MessageList>
			<MessageInput placeholder="Type message here" />
		  </ChatContainer>
		</MainContainer>
	  </div>;
	  </div>
	);
};

export default Home;
